import React from "react";
import "./button.scss";

const Button = ({ buttonLink, label, handlers, type }) => {
  return (
    <button
      {...handlers}
      type="submit"
      className={`button animation${buttonLink ? " button-link" : ""}`}
    >
      {label}
    </button>
  );
};

export default Button;
